import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Button, Label } from "reactstrap";

class Register extends Component {
  state = {
    first_name: null,
    last_name: null,
    email: null,
    profession: null
  };
  handleFirst_name = e => {
    this.setState({
      first_name: e.target.value
    });
  };
  handleLast_name = e => {
    this.setState({
      last_name: e.target.value
    });
  };
  handleEmail = e => {
    this.setState({
      email: e.target.value
    });
  };
  handleProfession = e => {
    this.setState({
      profession: e.target.value
    });
  };
  onClick = () => {
    this.props.firstOpe(
      this.state.first_name,
      this.state.last_name,
      this.state.email,
      this.state.profession
    );
  };

  render() {
    console.log(this.props);
    return (
      <div>
        <form onSubmit={this.onClick}>
          <h2>Hello from Register!</h2>
          <div>
            <Label>FirstName: </Label>
            <input
              placeholder="put your name here"
              onChange={this.handleFirst_name}
            />
          </div>
          <div>
            <Label>LastName: </Label>
            <input
              placeholder="put your last-name here"
              onChange={this.handleLast_name}
            />
          </div>
          <div>
            <Label>Email: </Label>
            <input
              placeholder="put your email here"
              onChange={this.handleEmail}
            />
          </div>
          <div>
            <Label>Profession: </Label>
            <input
              placeholder="put your profession here"
              onChange={this.handleProfession}
            />
          </div>
          <Button>Submit</Button>
        </form>

        <Link to="/render">Go to Render</Link>
      </div>
    );
  }
}

export default Register;
